function card(){
    return (<div>
            <h1>Eating lots of vegetables and fruit</h1>
            <p1>This is one of the most important diet habits. Vegetables and fruit are packed with nutrients (antioxidants, vitamins, minerals and fibre) and help you maintain a healthy weight by keeping you full longer.
            Fill half your plate with vegetables and fruit at every meal and snack.</p1>
            </div>
    )


}
export default card;
